Дверь в Хогвартс — интерактивная выставка, где каждый сможет стать главным героем легендарного волшебного мира Гарри Поттера!

Будь готов, здесь магия и тайны поджидают на каждом углу!

Какие приключения ждут вас и ваших детей:
— платформа 9 3/4;
— волнующая церемония распределения на факультеты;
— полёт на метле и турнир по квиддичу;
— встречи с магическими существами;
— уроки зельеварения и защиты от тёмных искусств;
— участие в Турнире Трёх Волшебников;
— экскурсия по дому семейства Уизли

Все тайны мы не раскроем, это предстоит сделать каждому из вас, юные маги!

Приглашаем окунуться в атмосферу школы волшебства Хогвартс!

Экспозиция состоит из 15 террариумов и вольеров.

Здесь можно познакомиться с такими редкими и поистине опасными животными как:
— Черепаха-матамата (эксклюзивная хищница внешне напоминает груду мусора);
— Огромная каймановая (кусающая) черепаха;
— Одна из самых тяжелых черепах— грифовая;
— Агрессивная китайская черепаха— трионикс.

В огромном террариуме, напоминающем акваторию Нила, гостей встретят нильские молодые крокодилы, каймановые крокодилы, гавиаловые крокодилы. Руководит царством рептилий 100-килограммовый нильский крокодил Гена и его подружка Чебурашка.

Также в экспозиции представлены сетчатый питон, тигровый питон, парагвайская анаконда, белогорлый варан и другие земноводные.
